package string;

import java.util.HashMap;
import java.util.HashSet;
import java.util.Map;
import java.util.Set;

public class MinDeletion {
    public static void main(String[] args) {
        String s = "";
        MinDeletion mn = new MinDeletion();
        System.out.println(mn.minDeleteBetter(s));
    }

    public int minDeleteBetter(String s) {
        if (s == null)
            return 0;
        int N = 26;
        int[] arr = new int[N];
        for (char ch : s.toCharArray()) {
            arr[ch - 'a']++;
        }
        Set<Integer> set = new HashSet<>();
        int count = 0;
        for (int i : arr) {
            if (set.contains(i)) {
                while (set.contains(i) && i != 0) {
                    i--;
                    count++;
                }
            }
            if (i != 0)
                set.add(i);
        }
        return count;
    }

    public int minDeletions(String s) {
        if (s == null || s.isEmpty())
            return 0;
        char[] chars = s.toCharArray();
        //Map<Integer,Integer> freq = new HashMap<>();
        int max = Integer.MIN_VALUE;
        int count = 0;
        Map<Character, Integer> map = new HashMap<>();
        for (char ch : chars) {
            Integer curr = map.getOrDefault(ch, 0);
            //freq.computeIfPresent(curr,(key,value)-> freq.put(key,freq.get(key)-1));
            curr += 1;
            map.put(ch, curr);
            max = Math.max(max, curr);
        }
        int[] arr = new int[max + 1];
        for (Map.Entry<Character, Integer> entry : map.entrySet()) {
            char key = entry.getKey();
            int value = entry.getValue();
            arr[value]++;
            int freq = arr[entry.getValue()];
            if (freq > 1) {
                int i = entry.getValue() - 1;
                while (i >= 0) {
                    if (arr[i] == 0 || i == 0) {
                        arr[i]++;
                        int diff = value - i;
                        map.put(key, diff);
                        count = count + diff;
                        arr[value]--;
                        break;
                    }
                    i--;
                }
                /*if (i == 0 && map.getOrDefault(key,0)>1) {
                   count+= map.getOrDefault(key,0);
                    arr[value]--;
                }*/
            }
        }
        return count;
    }
}
